import React from 'react';

import './styles/Home.css';
import logo from '../images/astronauts.svg';

function Home(){
   return (
      <div className="error_container">
         <h1>HOME</h1>
         <img className="logo_img" src={logo} alt="astronautas"/>
      </div>
   );
}

export default Home;
